import Vue from 'vue'
import Router from 'vue-router'
import Feed from './views/Feed.vue'

import Home from './views/Home.vue'

Vue.use(Router)

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'Feed',
      component: Feed
    },
    {
      path: '/my',
      name: 'home',
      component: Home

    }
  ]
})
